import React from 'react';

const LatestFinancialNews = () => {
  return (
    <div className="bg-[#1E293B] rounded-lg shadow-lg p-4">
      <h2 className="text-xl font-semibold mb-4">Latest Financial News</h2>
      <p className="text-gray-300">Financial news content will be displayed here.</p>
    </div>
  );
};

export default LatestFinancialNews;
